import React from "react";
import { listDecks } from "../utils/api";

function DeckInfo() {
  return (
    <div class="card">
      <div class="card-body">
        <h3 class="card-title">This is number1</h3>
        <p class="card-text">Number 1 is great, here are some cards</p>
        <div class="d-grid gap-2 d-md-block">
          <button class="btn btn-secondary m-s" type="button">
            View
          </button>
          <button class="btn btn-primary m-s" type="button">
            Study
          </button>
        </div>
      </div>
    </div>
  );
}

export default DeckInfo;
